ct the same program that was in my last vid i just realised! Never mind, I'll have a video up with some more interesting programs on at some point)  The bottom 3 register are wired up to the load switch and display, the other 2 still need doing. There is also a lot of debugging still to do, as i haven't done any proper tests on the upper 2 registers, and none of my more complex programs are running properly.\r\n\r\nAgain, sorry for the quality, my proper camera still isn't working...\r\n\r\nFor more information visit: "},{"text":"http://www.northdownfarm.co.uk/rory/tim/","navigationEndpoint":{"clickTrackingParams":"CB4Q040EGAIiEwiCq6nztN_8AhUKKbcAHRE0AyxI2MPFmbzi_9baAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbW9scW1KcEVWdUh2cEttOXd0MGpBb1FCWXRXQXxBQ3Jtc0tsRFdoX3dSVHRTLUdqZzl2S3ZRUEJONUE2S1VRVXdud0M4VkdwN291ZGlQSlFYLUxKOTJHREdtdFJkd0VZU3AtVXNDQkY0eDlRbGw4cmkyTnoyZjdlQzVFbERpMjhLcldBSXh4MkpLYzl5MDlFbXhPWQ\u0026q=http%3A%2F%2Fwww.northdownfarm.co.uk%2Frory%2Ftim%2F\u0026v=2q3_E8MxYdg","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbW9scW1KcEVWdUh2cEttOXd0MGpBb1FCWXRXQXxBQ3Jtc0tsRFdoX3dSVHRTLUdqZzl2S3ZRUEJONUE2S1VRVXdud0M4VkdwN291ZGlQSlFYLUxKOTJHREdtdFJkd0VZU3AtVXNDQkY0eDlRbGw4cmkyTnoyZjdlQzVFbERpMjhLcldBSXh4MkpLYzl5MDlFbXhPWQ\u0026q=http%3A%2F%2Fwww.northdownfarm.co.uk%2Frory%2Ftim%2F\u0026v=2q3_E8MxYdg","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":" ("},{"text":"http://rapidrory2.blogspot.com/2011/0...","navigationEndpoint":{"clickTrackingParams":"CB4Q040EGAIiEwiCq6nztN_8AhUKKbcAHRE0AyxI2MPFmbzi_9baAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbGtueXItY3JjX0ZUNExPNlRjVDRZSzJMOGVKd3xBQ3Jtc0ttaUhsWkF6dG5zSUtKZ0x2RDdnZ20zWGpwTlBqejlNOFc1a1ZPcy1RSzNGaUQ2TDdXX1RnR3JzZ3ZyMW
